import logo from "../Assets/Logo_trans.png";

function Header({text}){
    return <header className="">
        <div className="mira-logo">
            <img src={logo} alt="Logo" />
        </div>
        <br/>
        <div className="greeting-text">
            <h5>{text}</h5>
        </div>
    </header>
}

Header.propTypes = {
    text: PropTypes.string
}

export default Header;
